import React, { useState } from 'react';
import axios from 'axios';
import { Home, Brain } from 'lucide-react';

const ModelsPage = ({ goHome }) => {
  const [state, setState] = useState('');
  const [district, setDistrict] = useState('');
  const [crop, setCrop] = useState('');
  const [production, setProduction] = useState('');
  const [zn, setZn] = useState('');
  const [fe, setFe] = useState('');
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');

  const handlePredict = async () => {
    if (!state || !district || !crop || !production || !zn || !fe) {
      setError('Please fill all fields.');
      return;
    }
    setError('');
    setLoading(true);
    setResult(null);

    try {
      const response = await axios.post('http://localhost:5000/predict', {
        state,
        district,
        crop,
        production: parseFloat(production),
        zn: parseFloat(zn),
        fe: parseFloat(fe),
      });

      setResult(response.data); // Expected { quintal, tonne }
    } catch (err) {
      console.error(err);
      setError('Prediction failed. Please check input values.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-indigo-900 to-slate-900 p-6">
      <div className="max-w-3xl mx-auto bg-white/10 backdrop-blur-lg rounded-2xl border border-white/20 p-8">
        <button
          onClick={goHome}
          className="inline-flex items-center text-purple-400 hover:text-purple-300 transition-colors duration-200 mb-6"
        >
          <Home className="w-4 h-4 mr-2" />
          Back to Home
        </button>

        <div className="text-center mb-8">
          <Brain className="w-20 h-20 text-purple-400 mx-auto mb-4" />
          <h1 className="text-3xl font-bold text-white mb-2">Crop Price Prediction</h1>
          <p className="text-gray-300">Predict crop prices based on state, district, crop, and soil data.</p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">
          <input
            type="text"
            placeholder="State"
            value={state}
            onChange={(e) => setState(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
          <input
            type="text"
            placeholder="District"
            value={district}
            onChange={(e) => setDistrict(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
          <input
            type="text"
            placeholder="Crop"
            value={crop}
            onChange={(e) => setCrop(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
          <input
            type="number"
            placeholder="Production (tonnes)"
            value={production}
            onChange={(e) => setProduction(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
          <input
            type="number"
            placeholder="Zinc (Zn)"
            value={zn}
            onChange={(e) => setZn(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
          <input
            type="number"
            placeholder="Iron (Fe)"
            value={fe}
            onChange={(e) => setFe(e.target.value)}
            className="p-3 rounded-lg bg-white/20 text-white placeholder-gray-300 border border-white/20 focus:outline-none"
          />
        </div>

        {error && <p className="text-red-400 mb-4">{error}</p>}

        <button
          onClick={handlePredict}
          disabled={loading}
          className="w-full bg-purple-500 hover:bg-purple-600 text-white font-bold py-3 rounded-lg transition-colors duration-200"
        >
          {loading ? 'Predicting...' : 'Predict Price'}
        </button>

        {result && (
          <div className="mt-6 bg-white/10 p-6 rounded-xl border border-white/20 text-center">
            <h2 className="text-2xl font-bold text-white mb-2">Predicted Modal Price</h2>
            <p className="text-gray-300">₹{result.quintal.toFixed(2)} per Quintal</p>
            <p className="text-gray-300">₹{result.tonne.toFixed(2)} per Tonne</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default ModelsPage;
